import './index.css';

const popularRecipies=() =>{
    return (
        <div class="flex flex-col-2 h-[60vh] bg-red-400 ">
            <div class="">
                <p class="text-black-500 size-24">let's start cooking with </p>
                <p class="uppercase size-36">Popular Recipies</p>
                <p class="size-14">Welcome to Delicious Bites, your ultimate destination for culinary inspiration and mouthwatering recipes! Whether you're a seasoned chef or a kitchen novice, our food haven is designed to spark creativity, elevate your cooking skills, and tantalize your taste buds.</p>
                <button>Discover Recipies</button>
            </div>
            <div>
                <img src="imgs/food1.avif"></img>
                <img src="imgs/food2.avif"></img>
            </div>
        </div>
    )
};
export default popularRecipies ;
